import React from 'react'

import styled from 'styled-components'

const Modal = styled.div`
	width: 100vw;
	height: 100vh;
	background: rgba(0, 0, 0, 0.3);
`

const ConfirmModal = () => {
	return <h1>Modal</h1>
}

export default ConfirmModal
